import React from "react";


const Nav = () => {
    return (
        <div>
            <nav className="nav">
                <div>Profile</div>
                <div>Messages</div>
                <div>News</div>
                <div>Mu</div>
                <div>Profile</div>
            </nav>
        </div>
    );
};

export default Nav;
